import React, { Component } from 'react';

class Resultado extends Component {

    mostrarVideos = () => {
        console.log(this.props.videos);
    }

    render() { 
        return (
            <React.Fragment>
                {this.mostrarVideos()}
            </React.Fragment>
        );
    }
}
 
export default Resultado;
